    /**
     * Gets the attribute value for the calculated attribute TransWhIdAdds.
     * @return the TransWhIdAdds
     */
    public String getTransWhIdAdds() {
        if(getTransWhAddressId()!=null){
            PurOrderDlvrySchlAMImpl am = (PurOrderDlvrySchlAMImpl)this.getApplicationModule();
            am.getLovAddress().setNamedWhereClauseParam("SlocIdBind", getSlocId());
            am.getLovAddress().setNamedWhereClauseParam("CldIdBind", getCldId());
            am.getLovAddress().setNamedWhereClauseParam("AddsIdBind", getTransWhAddressId());
            am.getLovAddress().executeQuery();
            Row []rr = am.getLovAddress().getFilteredRows("AddsId", getTransWhAddressId());
            if(rr.length>0){
                if(rr[0].getAttribute("AddDesc")!=null){
                    return rr[0].getAttribute("AddDesc").toString();
                }else{
                    return (String) getAttributeInternal(TRANSWHIDADDS);  
                }
            }else{
                return (String) getAttributeInternal(TRANSWHIDADDS);   
            }
        }else{
        return (String) getAttributeInternal(TRANSWHIDADDS);
        }
    }

